import Header from '../components/header.js';
import Footer from '../components/footer.js';

function Contact()
{
    return(
        <>
        <Header />
        <div className='w-full h-[600px] relative flex items-center justify-center pl-10 pr-10 '>
            <div className='w-1/3 h-[200px] bg-gray-600 text-right'>
                <h1 className='text-white text-[32px]'>Bine ai venit,</h1> 
                <small>email@email.com</small>
            </div>
        </div>
        <Footer />
        </>
    )
}

export default Contact;
